OnOverdue.Script:
var cnt = jst.getDataSlotValue("escalateCounter");
var cls = jst.loadClass("com.rgicl.marcom.mail.Mailer");
var obj = cls.newInstance();
if(cnt == 0)
{
  obj.escalationNotify(jst.getProcessInstanceID(),jst.getWorkstepName(),2);
  cnt = ++cnt;
  jst.putDataSlot("escalateCounter", cnt);
}
if(cnt == 1)
{
  obj.escalationNotify(jst.getProcessInstanceID(),jst.getWorkstepName(),1);
  cnt = ++cnt;
  jst.putDataSlot("escalateCounter", cnt);
}
if(cnt == 2)
{
  obj.escalateAlert(jst.getProcessInstanceID(),jst.getWorkstepName());
}

